import React from 'react'
import Ratio from 'react-bootstrap/Ratio';


const Maplocation = () => {
    return (
        <div style={{ width: 660, height: 'auto' }}>
            <Ratio aspectRatio="16x9">
                <iframe style={{ width: "100%", height: "100px" }} src="https://maps.google.com/maps?q=sukarame bandar lampung&t=&z=17&ie=UTF8&iwloc=&output=embed" frameborder="0" scrolling="no" marginheight="0" marginwidth="0"></iframe><a href="https://embedgooglemap.2yu.co/">html embed google map</a>
            </Ratio>
        </div>

    )

}
export default Maplocation
